import Head from 'next/head';
import Layout from '../components/layout';
import HeadMetadata from '../components/head-metadata';
import ScreenShot from '../components/screen-shots/screen-shot';

const ScreenShots = () => (
    <Layout>
        <Head>
            {
                // need this syntax for Components to work in Head
                HeadMetadata()
            }
            <title>screenshots</title>
        </Head>
        <h1>screenshots</h1>
        <section>
            {screenShotData.foreach(screenShot => (
                <ScreenShot
                    {...screenShot}
                />
            ))}
        </section>
        <h2>
            <Link href="/">
                <a>Back to home</a>
            </Link>
        </h2>
    </Layout>
);

const screenShotData = [
    {
        src: "/game-screenshot_KTV-room-2.png",
        alt: "game screenshot of a KTV room",
        caption: "who knew moving bottles could affect so much?!"
    },
    {
        src: "/game-screenshot_eileen-1.png",
        alt: "game screenshot of speaking to Eileen",
        caption: "who knew moving bottles could affect so much?!"
    }
];
